sys_variable_value.value:
(function execute(inputs, outputs) {
    
    //look up created Satellite Task Assignment records
    var gr = new GlideRecord('x_1387186_ows_distance');
    gr.addQuery('satellite', inputs.satellite);
    gr.addQuery('table', inputs.table)
    gr.orderBy('dist');
    gr.query();
    var i = 0;

    //keep the first three (ordered by distance) and delete others
    while(gr.next()) {
        if (i < 3){
            i++;
        } else {
            gr.deleteRecord();
            gr.update();
            i++;
        }

    }

})(inputs, outputs);

